import React from 'react'

const Price = (props) => {

	if(props.type === 2){
		return (
			<td> 
				{props.price} * {props.days} = {props.total_price}
			</td>
		)
	}else{

		return (
			<td> 
				{props.price} * {props.days} = {props.total_price}
			</td>
		)
	}


}

export default Price
